import { Image } from "react-native";

const ImagenCard=()=>{
    return (
        <View style={styles.container}>
          
          <Image source={require('https://www.xatakandroid.com/listas/21-consejos-imprescindibles-para-hacer-buenas-fotos-con-tu-movil-android')}/>
          <Image source={require('https://www.xatakandroid.com/listas/21-consejos-imprescindibles-para-hacer-buenas-fotos-con-tu-movil-android')}style={{width:"45%",height:"45%", resizeMode:'contain'}} />

        </View>
      );
    };
    
export default ImagenCard();
